import React from "react";
import { IEmployee } from "../../models/IEmployee";

export const ItemsEmployee = ({
  deparment,
  hours_extra,
  salary,
  id_person,
  id_employee,
}: IEmployee) => {
  return (
    <React.Fragment>
      <div>{id_employee}</div>
      <div>{id_person}</div>
      <div>{deparment}</div>
      <div>{salary}</div>
      <div>{hours_extra}</div>
    </React.Fragment>
  );
};
